script: |
  super -f text -I q102.spq | sort > q102.out

inputs:
  - name: q102.spq
    data: |
      SELECT - 86 * + col2 + - col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN 97 + + col2 AND - col1 - - col1 + - - col0 + - ( col1 ) + + CAST ( NULL AS INTEGER ) * - - col2 / + - col0 * + + 56;
  - name: tab0

outputs:
  - name: q102.out
    data: |
